import InternalLayout from '../components/InternalLayout';
import TableTemplate from '../components/TableTemplate';

export default (props) => {
    let mymodal = () => <ModalLayout 
    buttonLocation='right' 
    buttonName='Remove' 
    icon='trash' 
    title='Delete user'
    modalContent={<ModalContent text={`Are you sure you want to delete ${user} account?`}/>}
    modalActions={<ModalAction />}
    current={{user:user,adminflag:adminflag,id:id,password:''}}
/>
    let headerData = [{
        name: 'Username',
        clickFunction: 'handleUserClick',
        haschildren: false,
        children: ''
    },
    {
        name: 'Password',
        clickFunction: 'handlePasswordClick',
        haschildren: false,
        children: ''
    },
    {
        name: 'AdminFlag',
        clickFunction: 'handleAdminClick',
        haschildren: true,
        children: mymodal
    }]

    ///need body info

    let tableData = [
        { Username: 'maria',Password: '******', AdminFlag: 'n' ,id: 2 },
        { Username: 'admin',Password: '******',AdminFlag: 'y' ,id: 1 }
    ]
    console.log('inside /dogs',props)
    return <><InternalLayout adminFlag='y'/><TableTemplate header={headerData} table={tableData}></TableTemplate></>
}
